import * as React from 'react';
import { Animated, Easing } from 'react-native';
import Svg, { Image } from 'react-native-svg';

import { IconProps } from './types';
import { moderateScale } from 'react-native-size-matters';

export const Boating = ({ size = moderateScale(300), color = '#000' }: IconProps) => {
  // Create animated value for horizontal movement
  const translateX = React.useRef(new Animated.Value(0)).current;

  // Set up animation when component mounts
  React.useEffect(() => {
    const animate = () => {
      Animated.sequence([
        Animated.timing(translateX, {
          toValue: 20,
          duration: 2000,
          easing: Easing.inOut(Easing.sin),
          useNativeDriver: true,
        }),
        Animated.timing(translateX, {
          toValue: 0,
          duration: 2000,
          easing: Easing.inOut(Easing.sin),
          useNativeDriver: true,
        }),
      ]).start(() => animate()); // Restart animation when complete
    };

    animate();
  }, []);

  // Wrap Svg in Animated.View
  return (
    <Animated.View style={{ transform: [{ translateX }] }}>
      <Svg
        width={size}
        height={size * (301 / 357)}
        viewBox="0 0 357 301"
        fillRule="evenodd"
        clipRule="evenodd"
        strokeLinejoin="round"
        strokeMiterlimit={2}>
        <Image
          id="_Image1"
          width="336px"
          height="290px"
          href="data:image/png;base64,"
        />
      </Svg>
    </Animated.View>
  );
};

export default Boating;
